  namespace: System.Web.UI.WebControls
  summary: Defines the template of the final step for creating a user account with the <xref href="System.Web.UI.WebControls.CreateUserWizard"></xref> control.
  remarks: The <xref:System.Web.UI.WebControls.CompleteWizardStep> class is derived from <xref:System.Web.UI.WebControls.TemplatedWizardStep> and used by the <xref:System.Web.UI.WebControls.CreateUserWizard> control. By default the <xref:System.Web.UI.WebControls.CompleteWizardStep> step is displayed after the <xref:System.Web.UI.WebControls.CreateUserWizardStep> step. The <xref:System.Web.UI.WebControls.CompleteWizardStep> step is a required step of the <xref:System.Web.UI.WebControls.CreateUserWizard> control.
  syntax:
    content: >-
      [System.ComponentModel.Browsable(false)]

      public sealed class CompleteWizardStep : System.Web.UI.WebControls.TemplatedWizardStep
