  type: Property
  assemblies:
  - System.Web
  namespace: System.Web.UI.WebControls
  summary: Gets or sets the type of user interface (UI) to display for the <xref href="System.Web.UI.WebControls.CompleteWizardStep"></xref> page of a <xref href="System.Web.UI.WebControls.CreateUserWizard"></xref> control.
  remarks: "The <xref:System.Web.UI.WebControls.CompleteWizardStep.StepType%2A> property specifies the type of navigation UI to display for the final user account creation step (the <xref:System.Web.UI.WebControls.CreateUserWizardStep> step) of the <xref:System.Web.UI.WebControls.CreateUserWizard> control.  \n  \n> [!CAUTION]\n>  The <xref:System.Web.UI.WebControls.CompleteWizardStep.StepType%2A> property overrides the <xref:System.Web.UI.WebControls.WizardStepBase.StepType%2A?displayProperty=fullName> property to ensure that <xref:System.Web.UI.WebControls.CompleteWizardStep> is always set to the <xref:System.Web.UI.WebControls.WizardStepType.Complete> value of the <xref:System.Web.UI.WebControls.WizardStepType> enumeration. Attempting to set the <xref:System.Web.UI.WebControls.CompleteWizardStep.StepType%2A> property to a different value will result in an <xref:System.InvalidOperationException>.  \n  \n This property cannot be set by themes or style sheet themes. For more information, see <xref:System.Web.UI.ThemeableAttribute> and [ASP.NET Themes and Skins](http://msdn.microsoft.com/library/5df3ebbd-d46c-4502-9406-02f9df4ef2c3)."
  syntax:
    content: >-
      [System.ComponentModel.Browsable(false)]

      [System.Web.UI.Themeable(false)]

      public override System.Web.UI.WebControls.WizardStepType StepType { get; set; }
    return:
      type: System.Web.UI.WebControls.WizardStepType
      description: The <xref href="System.Web.UI.WebControls.WizardStepType.Complete"></xref> enumeration value for the <xref href="System.Web.UI.WebControls.WizardStepType"></xref> enumeration.
  overload: System.Web.UI.WebControls.CompleteWizardStep.StepType*
  exceptions:
  - type: System.InvalidOperationException
    commentId: T:System.InvalidOperationException
    description: An attempt was made to set the <xref href="System.Web.UI.WebControls.CompleteWizardStep.StepType"></xref> property.
